import './navbar.scss';

export default function Navbar() {
    return (
        <nav>
            <div className="left">
                <a href="/">
                <img src="/logo.png" alt="" />
                <span>Neerrealstate</span>
                </a>
            <a href="/">Home</a>
            <a href="/">Agents</a>
            <a href="/">About us</a>
            <a href="/">Contact</a>
            </div>
            <div className="right">Right</div>

        </nav>
    );
}
